import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as r,d as t}from"./app.a3d402e1.js";var i="/assets/project-related-party-management.png",h="/assets/project-related-party-management-1.png",d="/assets/project-related-party-management-2.png",n="/assets/project-related-party-management-3.png",s="/assets/project-related-party-management-4.png";const p={},c=t('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u6838\u5FC3\u6982\u5FF5" tabindex="-1"><a class="header-anchor" href="#\u6838\u5FC3\u6982\u5FF5" aria-hidden="true">#</a> \u6838\u5FC3\u6982\u5FF5</h2><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u9879\u76EE\u59CB\u4E8E\u5E72\u7CFB\u4EBA\u9700\u6C42, \u7EC8\u4E8E\u5E72\u7CFB\u4EBA\u6EE1\u610F\u3002\u9879\u76EE\u5E72\u7CFB\u4EBA\u662F\u6307\u53D7\u9879\u76EE\u5F71\u54CD\u6216\u80FD\u5F71\u54CD\u9879\u76EE\u7684\u4EFB\u4F55\u4E2A\u4EBA\u3001\u5C0F\u7EC4\u6216\u7EC4\u7EC7, \u4E5F\u53EF\u4EE5\u8BF4, \u4E0E\u9879\u76EE\u6709\u76F4\u63A5\u6216\u95F4\u63A5\u5173\u7CFB\u7684\u4EFB\u4F55\u4E2A\u4EBA\u3001\u5C0F\u7EC4\u6216\u7EC4\u7EC7, \u90FD\u662F\u9879\u76EE\u5E72\u7CFB\u4EBA\u3002\u9879\u76EE\u5E72\u7CFB\u4EBA\u7BA1\u7406\u5E94\u8BE5\u6309\u7167\u5982\u4E0B\u6B65\u9AA4\u5F00\u5C55\uFF1A\u8BC6\u522B\u5E72\u7CFB\u4EBA\u3001\u89C4\u5212\u5E72\u7CFB\u4EBA\u7BA1\u7406\u3001\u7BA1\u7406\u5E72\u7CFB\u4EBA\u53C2\u4E0E\u548C\u63A7\u5236\u5E72\u7CFB\u4EBA\u53C2\u4E0E\u3002</p><p>\u9879\u76EE\u5E72\u7CFB\u4EBA\u7BA1\u7406\u662F\u9879\u76EE\u7BA1\u7406\u4E2D\u7684\u91CD\u8981\u5185\u5BB9\u4E4B\u4E00, \u76EE\u7684\u662F\u8C03\u52A8\u79EF\u6781\u56E0\u7D20, \u5316\u89E3\u6D88\u6781\u5F71\u54CD, \u786E\u4FDD\u9879\u76EE\u6210\u529F\u3002</p></div><p>\u76F8\u5173\u65B9 =&gt; \u4F1A\u53D7\u5230\u9879\u76EE\u7684\u79EF\u6781\u6216\u6D88\u6781\u5F71\u54CD, \u6216\u8005\u80FD\u5BF9\u9879\u76EE\u65BD\u52A0\u79EF\u6781\u6216\u6D88\u6781\u7684\u5F71\u54CD\u7684\u4EFB\u4F55\u4EBA\u3002</p><p>\u76F8\u5173\u65B9\u6EE1\u610F\u5EA6\u5E94\u4F5C\u4E3A\u9879\u76EE\u76EE\u6807\u52A0\u4EE5\u8BC6\u522B\u548C\u7BA1\u7406\u3002</p><p>\u8BC6\u522B\u76F8\u5173\u65B9\u548C\u5F15\u5BFC\u76F8\u5173\u65B9\u53C2\u4E0E\u7684\u8FC7\u7A0B\u9700\u8981\u8FED\u4EE3\u5F00\u5C55, \u81F3\u5C11\u8981\u5728\u4EE5\u4E0B\u65F6\u70B9\u5F00\u5C55\u8FD9\u4E9B\u6D3B\u52A8\uFF1A</p><ol><li>\u9879\u76EE\u8FDB\u5165\u5176\u751F\u547D\u5468\u671F\u7684\u4E0D\u540C\u9636\u6BB5\uFF1B</li><li>\u5F53\u524D\u76F8\u5173\u65B9\u4E0D\u518D\u4E0E\u9879\u76EE\u5DE5\u4F5C\u6709\u5173, \u6216\u8005\u5728\u9879\u76EE\u7684\u76F8\u5173\u65B9\u793E\u533A\u4E2D\u51FA\u73B0\u4E86\u65B0\u7684\u76F8\u5173\u65B9\u6210\u5458\uFF1B</li><li>\u7EC4\u7EC7\u5185\u90E8\u6216\u66F4\u5927\u533A\u57DF\u7684\u76F8\u5173\u65B9\u793E\u533A\u53D1\u751F\u91CD\u5927\u53D8\u5316\u3002</li></ol><h2 id="\u601D\u7EF4\u5BFC\u56FE" tabindex="-1"><a class="header-anchor" href="#\u601D\u7EF4\u5BFC\u56FE" aria-hidden="true">#</a> \u601D\u7EF4\u5BFC\u56FE</h2><p><img src="'+i+'" alt="\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406"></p><h2 id="\u542F\u52A8\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u542F\u52A8\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u542F\u52A8\u8FC7\u7A0B\u7EC4</h2><h3 id="\u8BC6\u522B\u76F8\u5173\u65B9" tabindex="-1"><a class="header-anchor" href="#\u8BC6\u522B\u76F8\u5173\u65B9" aria-hidden="true">#</a> \u8BC6\u522B\u76F8\u5173\u65B9</h3><p>\u8BC6\u522B\u76F8\u5173\u65B9\u662F\u5B9A\u671F\u8BC6\u522B\u9879\u76EE\u76F8\u5173\u65B9, \u5206\u6790\u548C\u8BB0\u5F55\u4ED6\u4EEC\u7684\u5229\u76CA\u3001\u53C2\u4E0E\u5EA6\u3001\u76F8\u4E92\u4F9D\u8D56\u6027\u3001\u5F71\u54CD\u529B\u548C\u5BF9\u9879\u76EE\u6210\u529F\u7684\u6F5C\u5728\u5F71\u54CD\u7684\u8FC7\u7A0B\u3002</p><h4 id="itto" tabindex="-1"><a class="header-anchor" href="#itto" aria-hidden="true">#</a> ITTO</h4><p>\u5934\u8111\u5199\u4F5C\uFF1A\u5934\u8111\u98CE\u66B4\u7684\u6539\u826F\u5F62\u5F0F, \u8BA9\u4E2A\u4EBA\u53C2\u4E0E\u8005\u6709\u65F6\u95F4\u5728\u5C0F\u7EC4\u521B\u610F\u8BA8\u8BBA\u5F00\u59CB\u524D\u5355\u72EC\u601D\u8003\u95EE\u9898\u3002\u4FE1\u606F\u53EF\u901A\u8FC7\u9762\u5BF9\u9762\u5C0F\u7EC4\u4F1A\u8BAE\u6536\u96C6, \u6216\u5728\u7531\u6280\u672F\u652F\u6301\u7684\u865A\u62DF\u73AF\u5883\u4E2D\u6536\u96C6\u3002</p><p>\u76F8\u5173\u65B9\u5206\u6790\uFF1A\u76F8\u5173\u65B9\u5206\u6790\u4F1A\u4EA7\u751F\u76F8\u5173\u65B9\u6E05\u5355\u548C\u5173\u4E8E\u76F8\u5173\u65B9\u7684\u5404\u79CD\u4FE1\u606F, \u5305\u62EC\uFF1A\u5174\u8DA3\u3001\u6743\u5229\u3001\u6240\u6709\u6743\u3001\u77E5\u8BC6\u3001\u8D21\u732E\u3002</p><p>\u6743\u529B\u5229\u76CA\u65B9\u683C\u3001\u6743\u529B\u5F71\u54CD\u65B9\u683C, \u6216\u4F5C\u7528\u5F71\u54CD\u65B9\u683C</p><p>\u6743\u5229 =&gt; \u804C\u6743 \u5229\u76CA =&gt; \u5BF9\u9879\u76EE\u7ED3\u679C\u7684\u5173\u6CE8\u7A0B\u5EA6 \u5F71\u54CD =&gt; \u4E3B\u52A8\u53C2\u4E0E\u9879\u76EE\u7684\u7A0B\u5EA6 \u4F5C\u7528 =&gt; \u6539\u53D8\u9879\u76EE\u8BA1\u5212\u6216\u6267\u884C\u7684\u80FD\u529B</p><p>\u76F8\u5173\u65B9\u767B\u8BB0\u518C\uFF1A\u8EAB\u4EFD\u4FE1\u606F\u3001\u8BC4\u4F30\u4FE1\u606F\u3001\u76F8\u5173\u65B9\u5206\u7C7B\u3002</p><p><img src="'+h+'" alt="\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406-\u8BC6\u522B\u76F8\u5173\u65B9"></p><h2 id="\u89C4\u5212\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u89C4\u5212\u8FC7\u7A0B\u7EC4</h2><h3 id="\u89C4\u5212\u76F8\u5173\u65B9\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u76F8\u5173\u65B9\u7BA1\u7406" aria-hidden="true">#</a> \u89C4\u5212\u76F8\u5173\u65B9\u7BA1\u7406</h3><p>\u6839\u636E\u76F8\u5173\u65B9\u7684\u9700\u6C42\u3001\u671F\u671B\u3001\u5229\u76CA\u548C\u5BF9\u9879\u76EE\u7684\u6F5C\u5728\u5F71\u54CD, \u5236\u5B9A\u9879\u76EE\u76F8\u5173\u65B9\u53C2\u4E0E\u9879\u76EE\u7684\u65B9\u6CD5\u7684\u8FC7\u7A0B\u3002\u672C\u8FC7\u7A0B\u7684\u4E3B\u8981\u4F5C\u7528\u662F, \u63D0\u4F9B\u4E0E\u76F8\u5173\u65B9\u8FDB\u884C\u6709\u6548\u4E92\u52A8\u7684\u53EF\u884C\u8BA1\u5212\u3002</p><h4 id="itto-1" tabindex="-1"><a class="header-anchor" href="#itto-1" aria-hidden="true">#</a> ITTO</h4><p>\u76F8\u5173\u65B9\u53C2\u4E0E\u8BA1\u5212\uFF1A\u76F8\u5173\u65B9\u53C2\u4E0E\u8BA1\u5212\u53EF\u5305\u62EC\uFF08\u4F46\u4E0D\u9650\u4E8E\uFF09\u8C03\u52A8\u4E2A\u4EBA\u6216\u76F8\u5173\u65B9\u53C2\u4E0E\u7684\u7279\u5B9A\u7B56\u7565\u6216\u65B9\u6CD5\u3002</p><p><img src="'+d+'" alt="\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406-\u89C4\u5212\u76F8\u5173\u65B9\u7BA1\u7406"></p><h2 id="\u6267\u884C\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u6267\u884C\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u6267\u884C\u8FC7\u7A0B\u7EC4</h2><h3 id="\u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E" tabindex="-1"><a class="header-anchor" href="#\u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E" aria-hidden="true">#</a> \u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E</h3><p>\u4E0E\u76F8\u5173\u65B9\u8FDB\u884C\u6C9F\u901A\u548C\u534F\u4F5C\u4EE5\u6EE1\u8DB3\u5176\u9700\u6C42\u4E0E\u671F\u671B\u3001\u5904\u7406\u95EE\u9898, \u5E76\u4FC3\u8FDB\u76F8\u5173\u65B9\u5408\u7406\u53C2\u4E0E\u7684\u8FC7\u7A0B\u3002\u4E3B\u8981\u4F5C\u7528\u662F, \u8BA9\u9879\u76EE\u7ECF\u7406\u80FD\u591F\u63D0\u9AD8\u76F8\u5173\u65B9\u7684\u652F\u6301, \u5E76\u5C3D\u53EF\u80FD\u964D\u4F4E\u76F8\u5173\u65B9\u7684\u62B5\u5236\u3002</p><p>\u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E\u5305\u62EC\u4EE5\u4E0B\u6D3B\u52A8\uFF1A</p><ol><li>\u5728\u9002\u5F53\u7684\u9879\u76EE\u9636\u6BB5\u5F15\u5BFC\u76F8\u5173\u65B9\u53C2\u4E0E, \u4EE5\u4FBF\u83B7\u53D6\u3001\u786E\u8BA4\u6216\u7EF4\u6301\u4ED6\u4EEC\u5BF9\u9879\u76EE\u6210\u529F\u7684\u6301\u7EED\u627F\u8BFA\uFF1B</li><li>\u901A\u8FC7\u8C08\u5224\u548C\u6C9F\u901A\u7BA1\u7406\u76F8\u5173\u65B9\u671F\u671B\uFF1B</li><li>\u901A\u8FC7\u8C08\u5224\u548C\u6C9F\u901A\u7BA1\u7406\u76F8\u5173\u65B9\u671F\u671B\uFF1B</li><li>\u6F84\u6E05\u548C\u89E3\u51B3\u5DF2\u8BC6\u522B\u7684\u95EE\u9898\u3002</li></ol><h4 id="itto-2" tabindex="-1"><a class="header-anchor" href="#itto-2" aria-hidden="true">#</a> ITTO</h4><p><img src="'+n+'" alt="\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406-\u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E"></p><h2 id="\u76D1\u63A7\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u76D1\u63A7\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u76D1\u63A7\u8FC7\u7A0B\u7EC4</h2><h3 id="\u76D1\u7763\u76F8\u5173\u65B9\u53C2\u4E0E" tabindex="-1"><a class="header-anchor" href="#\u76D1\u7763\u76F8\u5173\u65B9\u53C2\u4E0E" aria-hidden="true">#</a> \u76D1\u7763\u76F8\u5173\u65B9\u53C2\u4E0E</h3><p>\u76D1\u7763\u9879\u76EE\u76F8\u5173\u65B9\u5173\u7CFB, \u5E76\u901A\u8FC7\u4FEE\u8BA2\u53C2\u4E0E\u7B56\u7565\u548C\u8BA1\u5212\u6765\u5F15\u5BFC\u76F8\u5173\u65B9\u5408\u7406\u53C2\u4E0E\u9879\u76EE\u7684\u8FC7\u7A0B\u3002\u4E3B\u8981\u4F5C\u7528\u662F, \u968F\u7740\u9879\u76EE\u8FDB\u5C55\u548C\u73AF\u5883\u53D8\u5316, \u7EF4\u6301\u6216\u63D0\u5347\u76F8\u5173\u65B9\u53C2\u4E0E\u6D3B\u52A8\u7684\u6548\u7387\u548C\u6548\u679C\u3002</p><h4 id="itto-3" tabindex="-1"><a class="header-anchor" href="#itto-3" aria-hidden="true">#</a> ITTO</h4><p><img src="'+s+'" alt="\u9879\u76EE\u76F8\u5173\u65B9\u7BA1\u7406-\u76D1\u7763\u76F8\u5173\u65B9\u53C2\u4E0E"></p><h2 id="\u4E8B\u5148\u4E0E\u4E8B\u540E" tabindex="-1"><a class="header-anchor" href="#\u4E8B\u5148\u4E0E\u4E8B\u540E" aria-hidden="true">#</a> \u4E8B\u5148\u4E0E\u4E8B\u540E</h2><ul><li>\u4E8B\u5148\uFF1A\u65E9\u8BC6\u522B\u3001\u65E9\u5206\u6790\u3001\u65E9\u53C2\u4E0E</li><li>\u4E8B\u540E\uFF1A\u7BA1\u7406\u76F8\u5173\u65B9\u53C2\u4E0E\uFF08\u6216\u5BA1\u67E5\u76F8\u5173\u65B9\u53C2\u4E0E\u8BA1\u5212\uFF09</li></ul>',39),l=[c];function o(m,u){return e(),r("div",null,l)}var g=a(p,[["render",o],["__file","project-related-party-management.html.vue"]]);ex